#!/usr/bin/perl
# 64P1EWW - SuitAbstraction.pm generated by pokrsabm which was created by Pip Stuart <Pip@CPAN.Org> to store all possible Texas Hold'Em Poker Suit-Abstracted
#   Boards and a function to abstract suits from any board.  Also has a PartyPoker Log-file Parser.
package Games::Cards::Poker::SuitAbstraction;
require Exporter;
use base qw(Exporter);
use Math::BaseCnv       qw(:all);
use Games::Cards::Poker qw(:all);
our @EXPORT = qw(SMAP PAMS PPLP SABM SABZ);
my $dbug = 1;
my @smap = (); sub SMAP { return(@smap); }
my @pams = (); sub PAMS { return(@pams); }
sub PPLP { # PartyPoker Log Parser returns hashref to all data from a specified log
  my $logf = shift() || 'Poker_Lads.txt'; my %ldat; my $gndx;
  if(-e $logf) {
    open(LOGF, '<', $logf);
    while(<LOGF>) {
      chomp(); s/$//; # get rid of newlin && ^M if at end
      if(/^(Comparing files \\PROGRAM |Resync Failed.  Files are too different|\*{5} \\PROGRAM |\*{5}$)/) { # just skip over these FC.exe artifacts
      } elsif(/^Game #(\d+) starts.$/) { # load header all at once here
        $gndx = $1; <LOGF>; # save game-index && dump the empty header line
        $_ = <LOGF>; chomp(); s/$//; # get rid of newlin && ^M if at end
        unless(/^#Game No : $gndx $/) {
#          print "!*EROR*!  '$_' didn't match Game '$gndx' starts!\n";
          next();
        }
        $gndx = b64($gndx);
        $_ = <LOGF>; chomp(); s/$//; # get rid of newlin && ^M if at end
        unless(/^\*\*\*\*\* Hand History for Game (\d+) \*\*\*\*\*$/ && $1 == b10($gndx)) {
#          print "!*EROR*!  $_ didn't match Game $gndx starts!\n";
          $ldat{$gndx}{'incf'} = 1; # set incomplete header flag
          next();
        }
        $_ = <LOGF>; chomp(); s/$//; # get rid of newlin && ^M if at end
        unless(/^\$([^\/]+)\/\$(\S+) Texas Hold'em - (\w+,) (\w+) (\d\d), (\d\d):(\d\d):(\d\d) (\w+) (\d\d\d\d)$/) {
#          print "!*EROR*!  Stakes and date not recognized in:$_!\n"; # above needs to match more stakes values
          $ldat{$gndx}{'incf'} = 1; # set incomplete header flag
          next();
        }
        ($ldat{$gndx}{'stkl'}, $ldat{$gndx}{'stkh'}, $ldat{$gndx}{'dow' }, $ldat{$gndx}{'M'   }, $ldat{$gndx}{'D'   },
         $ldat{$gndx}{'h'   }, $ldat{$gndx}{'m'   }, $ldat{$gndx}{'s'   }, $ldat{$gndx}{'Z'   }, $ldat{$gndx}{'Y'   }) =
         /^\$([^\/]+)\/\$(\S+) Texas Hold'em - (\w+,) (\w+) (\d\d), (\d\d):(\d\d):(\d\d) (\w+) (\d\d\d\d)$/;
        # could maybe just pass whole date string to PT constructor then adjust for ET instead of making so many fields
        $_ = <LOGF>; chomp(); s/$//; # get rid of newlin && ^M if at end
        unless(/^Table (.+)$/) {
#          print "!*EROR*!  $_ didn't match expected Table name pattern!\n";
          $ldat{$gndx}{'incf'} = 1; # set incomplete header flag
          next();
        }
        $ldat{$gndx}{'tnam'} =  $1; # tabl name
        $_ = <LOGF>; chomp(); s/$//; # get rid of newlin && ^M if at end
        unless(/^Seat (\d+) is the button$/) {
#          print "!*EROR*!  $_ didn't match expected button pattern!\n";
          $ldat{$gndx}{'incf'} = 1; # set incomplete header flag
          next();
        }
        $ldat{$gndx}{'butn'} = ($1 - 1);
        $_ = <LOGF>; chomp(); s/$//; # get rid of newlin && ^M if at end
        unless(/^Total number of players : (\d+) $/) {
#          print "!*EROR*!  $_ didn't match expected player count pattern!\n";
          $ldat{$gndx}{'incf'} = 1; # set incomplete header flag
          next();
        }
        $ldat{$gndx}{'pcou'} =  $1; # plyr coun
        for my $pndx (1..$ldat{$gndx}{'pcou'}) {
          $_ = <LOGF>;
          unless(defined($_) && length($_)) { # need early test for game terminated during player roster part of header
#            print "!*EROR*!  $_ (undef or !length) didn't match expected player seat and bankroll pattern!\n";
            $ldat{$gndx}{'incf'} = 1; # set incomplete header flag
            $pndx = $ldat{$gndx}{'pcou'};
            next(); # if wrong player num detected here, then header breaks and already maybe slurps small blinds or next game start line?
          }
          chomp(); s/$//; # get rid of newlin && ^M if at end
          unless(/^Seat (\d+): (\w+) \( \$(\d+(\.\d\d)?) \)$/) {
#            print "!*EROR*!  $_ didn't match expected player seat and bankroll pattern!\n";
            $ldat{$gndx}{'incf'} = 1; # set incomplete header flag
            $pndx = $ldat{$gndx}{'pcou'};
            next(); # if wrong player num detected here, then header breaks and already maybe slurps small blinds or next game start line?
          }
          $ldat{$gndx}{'pnmz'}{$2} = $1 - 1;         # map plyr namz to seatz
          $ldat{$gndx}{'pdat'}[$1 - 1] = [ $2, $3 ]; # map seatz to plyr namz && bank rolz ( later [2] field added as flag for player still in-hand)
        }
        next() if(defined($_) && length($_) && $_ eq 'Table Closed');
        # maybe need to test for player messages in header too?
      } elsif(/^([^:]+): (.+)$/ && exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'mesg', $2 ]);
      } elsif(/^(\w+) posts small blind (\+ dead )?\[\$(\d+(\.\d\d)?)\]\.$/ && exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'smbl', $3 ]);
        push(@{$ldat{$gndx}{'glog'}[-1]}, 'dead') if(defined($2));
      } elsif(/^(\w+) posts big blind (\+ dead )?\[\$(\d+(\.\d\d)?)\]\.$/   && exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'bgbl', $3 ]);
        push(@{$ldat{$gndx}{'glog'}[-1]}, 'dead') if(defined($2));
      } elsif(/^\*\* Dealing down cards \*\*$/) {
        $_ = <LOGF>; chomp(); chop(); unless(/^Dealt to (\w+) \[  ([AKQJT2-9][shdc]) ([AKQJT2-9][shdc]) \]$/) { print "!*EROR*!  $_ didn't match expected hole   dealt pattern!\n"; next(); }
        $ldat{$gndx}{'pnam'} = $1;
        $ldat{$gndx}{'hole'} = [ $2, $3 ];
      } elsif(/^\*\* Dealing (Flop) \*\* \[ ([AKQJT2-9][shdc]), ([AKQJT2-9][shdc]), ([AKQJT2-9][shdc]) \]$/) {
        $ldat{$gndx}{'bord'} = [ $2, $3, $4 ];
        push(@{$ldat{$gndx}{'glog'}}, [                      -1 , 'flop', $2, $3, $4 ]);
      } elsif(/^\*\* Dealing (Turn|River) \*\* \[ ([AKQJT2-9][shdc]) \]$/) {
        push(@{$ldat{$gndx}{'bord'}}, $2);
        push(@{$ldat{$gndx}{'glog'}}, [                      -1 , 'turn', $2 ]);
               $ldat{$gndx}{'glog'}[-1][1] = 'rivr' if($1 eq 'River');
      } elsif(/^(\w+) folds.$/                            &&  exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'fldz' ]);
      } elsif(/^(\w+) checks.$/                           &&  exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'chkz' ]);
      } elsif(/^(\w+) calls \[\$(\d+(\.\d\d)?)\]\.$/      &&  exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'calz', $2 ]);
      } elsif(/^(\w+) bets \[\$(\d+(\.\d\d)?)\]\.$/       &&  exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'betz', $2 ]);
      } elsif(/^(\w+) is all-In  \[\$(\d+(\.\d\d)?)\]$/   &&  exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'alin', $2 ]);
      } elsif(/^(\w+) raises \[\$(\d+(\.\d\d)?)\]\.$/     &&  exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'raiz', $2 ]);
      } elsif(/^(\w+) shows \[ ([AKQJT2-9][shdc]), ([AKQJT2-9][shdc]) \] (.+)\.$/ && exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'shwz', $2, $3, $4 ]);
      } elsif(/^(\w+) doesn't show \[ ([AKQJT2-9][shdc]), ([AKQJT2-9][shdc]) \] (.+)\.$/ && exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'dshw', $2, $3, $4 ]); # redundant with @'hole'?
      } elsif(/^(\w+) does not show cards\.$/             &&  exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'dshw' ]);
      } elsif(/^(\w+) has left the table\.$/              &&  exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'left' ]);
      } elsif(/^(\w+) has left the table\.$/              && !exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [                      $1 , 'left' ]);
      } elsif(/^(\w+) is sitting out\.$/                  &&  exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'sito' ]);
      } elsif(/^(\w+) could not respond in time\.\(disconnected\)$/ && exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'disc' ]);
      } elsif(/^(\w+) did not respond in time\.$/ && exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'timo' ]);
      } elsif(/^(\w+) wins \$(\d+(\.\d\d)?)(.*)$/         && exists($ldat{$gndx}{'pnmz'}{$1})) {
        push(@{$ldat{$gndx}{'glog'}}, [ $ldat{$gndx}{'pnmz'}{$1}, 'winz', $2, $4 ]);
               $ldat{$gndx}{'glog'}[-1][3] =~ s/^from  (the main pot|side pot #\d+)  with//;
               $ldat{$gndx}{'glog'}[-1][4] =  $1 if(defined($1)); # save which pot win came from
      } elsif(/^(\w+) has joined the table.$/) {
        push(@{$ldat{$gndx}{'glog'}}, [                      $1 , 'join' ]);
      } elsif(/win big.*!$/i) {
        push(@{$ldat{$gndx}{'glog'}}, [                      $_ , 'wnbg' ]);
      } elsif($_ eq 'Table Closed') {
        push(@{$ldat{$gndx}{'glog'}}, [                      -1,  'tcls' ]);
      } elsif($_ =~ /^The hand history for this hand number is not available here/                                                                     ||
              $_ eq  'The hand history for this hand number is not available here.Please use Instant Hand History in the "Game Rules & Options"  menu' ||
              $_ eq  'to have this hand history delivered to the email address you have registered with us.'                                           ||
              $_ eq  'The hand history for this hand number is not available here.Please use Instant Hand History in the "Game Rules & Options"  menu to have this hand history delivered to the email address you have registered with us') { # the chop removed the period since this line doesn't get a ^M sometimes
  #      push(@{$ldat{$gndx}{'glog'}}, [                      -1,  'tcl2' ]);
      } elsif(/\S/) {
        if(defined($gndx) && $gndx && exists($ldat{$gndx}) && exists($ldat{$gndx}{'glog'})) {
          push(@{$ldat{$gndx}{'glog'}}, [                    -1,  'unkn', $_ ]); # log unrecognized lines in recent data struct if possible
        }
        if($dbug) {
          open(DBFL, '>>', '/tmp/pplp.err'); print DBFL "LogFile:$logf has unrecognized log line:$_:\n"; close(DBFL);
        }
      }
    }
    close(LOGF);
  }
  #print Dumper(\%ldat);
  return(\%ldat);
}
sub SABM { # takes a list of 5 integer card indices (Dec) and returns 5 suit-abstracted indices (Suit-Abstracted Board Mapper)
  my @bord = (shift, shift, shift, shift, shift); my @sabs = (); @smap = (); @pams = ();
  my @rkst = (                                    # indices of ranks && suits for fast lookup
    [  0, 0 ], [  0, 1 ], [  0, 2 ], [  0, 3 ],   #   (i.e., should be faster than cndx / 13 && cndx % 13 but I didn't benchmark)
    [  1, 0 ], [  1, 1 ], [  1, 2 ], [  1, 3 ], 
    [  2, 0 ], [  2, 1 ], [  2, 2 ], [  2, 3 ], 
    [  3, 0 ], [  3, 1 ], [  3, 2 ], [  3, 3 ], 
    [  4, 0 ], [  4, 1 ], [  4, 2 ], [  4, 3 ], 
    [  5, 0 ], [  5, 1 ], [  5, 2 ], [  5, 3 ], 
    [  6, 0 ], [  6, 1 ], [  6, 2 ], [  6, 3 ], 
    [  7, 0 ], [  7, 1 ], [  7, 2 ], [  7, 3 ], 
    [  8, 0 ], [  8, 1 ], [  8, 2 ], [  8, 3 ], 
    [  9, 0 ], [  9, 1 ], [  9, 2 ], [  9, 3 ], 
    [ 10, 0 ], [ 10, 1 ], [ 10, 2 ], [ 10, 3 ], 
    [ 11, 0 ], [ 11, 1 ], [ 11, 2 ], [ 11, 3 ], 
    [ 12, 0 ], [ 12, 1 ], [ 12, 2 ], [ 12, 3 ] );
  for(my $zndx = 0; $zndx < 5; $zndx++) { # map suits
    if(!defined($smap[$rkst[$bord[$zndx]][1]])) {
      if   (!defined($pams[0])) { $smap[$rkst[$bord[$zndx]][1]] = 0; $pams[0] = $rkst[$bord[$zndx]][1]; }
      elsif(!defined($pams[1])) { $smap[$rkst[$bord[$zndx]][1]] = 1; $pams[1] = $rkst[$bord[$zndx]][1]; }
      elsif(!defined($pams[2])) { $smap[$rkst[$bord[$zndx]][1]] = 2; $pams[2] = $rkst[$bord[$zndx]][1]; }
      elsif(!defined($pams[3])) { $smap[$rkst[$bord[$zndx]][1]] = 3; $pams[3] = $rkst[$bord[$zndx]][1]; }
    }
    $sabs[$zndx] = $bord[$zndx] + ($smap[$rkst[$bord[$zndx]][1]] - $rkst[$bord[$zndx]][1]); # translate the current @bord card into a S-A card in @sabs
  }
  if  ($sabs[0] > $sabs[1]) { ($sabs[0], $sabs[1]) = ($sabs[1], $sabs[0]); } # SortIndices
  if  ($sabs[3] > $sabs[4]) { ($sabs[3], $sabs[4]) = ($sabs[4], $sabs[3]); }
  if  ($sabs[1] > $sabs[3]) { ($sabs[1], $sabs[3]) = ($sabs[3], $sabs[1]);
    if($sabs[0] > $sabs[1]) { ($sabs[0], $sabs[1]) = ($sabs[1], $sabs[0]); }
    if($sabs[3] > $sabs[4]) { ($sabs[3], $sabs[4]) = ($sabs[4], $sabs[3]); }
    if($sabs[1] > $sabs[3]) { ($sabs[1], $sabs[3]) = ($sabs[3], $sabs[1]); } }
  if  ($sabs[2] > $sabs[3]) { ($sabs[2], $sabs[3]) = ($sabs[3], $sabs[2]);
    if($sabs[3] > $sabs[4]) { ($sabs[4], $sabs[3]) = ($sabs[3], $sabs[4]); } }
 elsif($sabs[1] > $sabs[2]) { ($sabs[1], $sabs[2]) = ($sabs[2], $sabs[1]);
    if($sabs[0] > $sabs[1]) { ($sabs[0], $sabs[1]) = ($sabs[1], $sabs[0]); } }
  if     ($rkst[$sabs[0]][0] == $rkst[$sabs[1]][0]) { # break down cards that have the same ranks
    if     ($rkst[$sabs[1]][0] == $rkst[$sabs[2]][0]) {
      if     ($rkst[$sabs[2]][0] == $rkst[$sabs[3]][0]) { # 4Kind: 41  # AAAAK:shdcs shdch shdcd shdcc
        if     ($rkst[$sabs[4]][1]) { $sabs[4] -= $rkst[$sabs[4]][1]; }                                               # shdcs => [ shdch shdcd shdcc ]
      } elsif($rkst[$sabs[3]][0] == $rkst[$sabs[4]][0]) { # FullH: 32  # AAAKK:shdsh shdsd shdsc shdhd shdhc shddc
        if     ($rkst[$sabs[3]][1] != $rkst[$sabs[4]][1] && $rkst[$sabs[3]][1] <= 1 && $rkst[$sabs[4]][1] == 2) {     # shdsh => [ shdsd shdhd ]
          $sabs[3] -=  $rkst[$sabs[3]][1];
          $sabs[4] -= ($rkst[$sabs[4]][1] - 1);
        } elsif($rkst[$sabs[3]][1] <= 2 && $rkst[$sabs[4]][1] == 3) {                                                 # shdsc => [ shdhc shddc ]
          $sabs[3] -=  $rkst[$sabs[3]][1];
        }
      } else                                          { # 3Kind: 311  # AAAKQ:shdss shdsh shdsd shdsc shdhs shdhh shdhd shdhc shdds shddh shddd shddc shdcs shdch shdcd shdcc
        if     ($rkst[$sabs[3]][1] == $rkst[$sabs[4]][1] && $rkst[$sabs[3]][1] <= 2) {                                # shdss => [ shdhh shddd ]
          $sabs[3] -=  $rkst[$sabs[3]][1];
          $sabs[4] -=  $rkst[$sabs[4]][1];
        } elsif($rkst[$sabs[3]][1] != $rkst[$sabs[4]][1] && $rkst[$sabs[3]][1] <= 2 && $rkst[$sabs[4]][1] <= 2) {     # shdsh => [ shdsd shdhs shdhd shdds shddh ]
          $sabs[3] -=  $rkst[$sabs[3]][1];
          $sabs[4] -= ($rkst[$sabs[4]][1] - 1);
        } elsif($rkst[$sabs[3]][1] <= 2 && $rkst[$sabs[4]][1] == 3) {                                                 # shdsc => [ shdhc shddc ]
          $sabs[3] -=  $rkst[$sabs[3]][1];
        } elsif($rkst[$sabs[4]][1] <= 2 && $rkst[$sabs[3]][1] == 3) {                                                 # shdcs => [ shdch shdcd ]
          $sabs[4] -=  $rkst[$sabs[4]][1];
        }                                                                                                             # shdcc => [ ]
      }
    } elsif($rkst[$sabs[2]][0] == $rkst[$sabs[3]][0]) {
      if     ($rkst[$sabs[3]][0] == $rkst[$sabs[4]][0]) { # FullH: 23  # AAKKK:shshd shsdc shhdc
        if     ($rkst[$sabs[2]][1] == 1) {                                                                            # shsdc => [ shhdc ]
          $sabs[2] -=  $rkst[$sabs[2]][1];
        }                                                                                                             # shshd => [ ]
      } else                                          { # 2Pair: 221 # AAKKQ:shshs shshh shshd shsds shsdh shsdd shsdc shhds shhdh shhdd shhdc shdcs shdch shdcd shdcc
        if     ($rkst[$sabs[2]][1] == 0 && $rkst[$sabs[3]][1] == 1 && $rkst[$sabs[4]][1] == 1) {                      # shshs => [ shshh ]
          $sabs[4] -=  $rkst[$sabs[4]][1];
                                                                                                                      # shshd => [ ]
        } elsif($rkst[$sabs[2]][1] == 1 && $rkst[$sabs[3]][1] == 2 && $rkst[$sabs[4]][1] == 1) {                      # shsds => [ shhdh ]
          $sabs[2] -=  $rkst[$sabs[2]][1];
          $sabs[4] -=  $rkst[$sabs[4]][1];
        } elsif($rkst[$sabs[2]][1] == 1 && $rkst[$sabs[3]][1] == 2 && $rkst[$sabs[4]][1] == 0) {                      # shsdh => [ shhds ]
          $sabs[2] -=  $rkst[$sabs[2]][1];
          $sabs[3] -= ($rkst[$sabs[3]][1] - 2);
          $sabs[4] -= ($rkst[$sabs[4]][1] - 1);
        } elsif($rkst[$sabs[2]][1] == 1 && $rkst[$sabs[3]][1] == 2 && $rkst[$sabs[4]][1] == 2) {                      # shsdd => [ shhdd ]
          $sabs[2] -=  $rkst[$sabs[2]][1];
        } elsif($rkst[$sabs[2]][1] == 1 && $rkst[$sabs[3]][1] == 2 && $rkst[$sabs[4]][1] == 3) {                      # shsdc => [ shhdc ]
          $sabs[2] -=  $rkst[$sabs[2]][1];
        } elsif($rkst[$sabs[2]][1] == 2 && $rkst[$sabs[3]][1] == 3 && $rkst[$sabs[4]][1] == 1) {                      # shdcs => [ shdch ]
          $sabs[4] -=  $rkst[$sabs[4]][1];
        } elsif($rkst[$sabs[2]][1] == 2 && $rkst[$sabs[3]][1] == 3 && $rkst[$sabs[4]][1] == 3) {                      # shdcd => [ shdcc ]
          $sabs[4] -= ($rkst[$sabs[4]][1] - 2);
        }
      }
    } elsif($rkst[$sabs[3]][0] == $rkst[$sabs[4]][0]) {   # 2Pair: 212 # AAKQQ:shssh shssd shshd shsdc shhsh shhsd shhhd shhdc shdsh shdsd shdsc shdhd shdhc shddc
        if     ($rkst[$sabs[2]][1] == 1 && $rkst[$sabs[3]][1] == 0 && $rkst[$sabs[4]][1] == 1) {                      # shssh => [ shhsh ]
          $sabs[2] -=  $rkst[$sabs[2]][1];
        } elsif($rkst[$sabs[2]][1] == 1 && $rkst[$sabs[3]][1] == 1 && $rkst[$sabs[4]][1] == 2) {                      # shssd => [ shhhd ]
          $sabs[2] -=  $rkst[$sabs[2]][1];
          $sabs[3] -=  $rkst[$sabs[3]][1];
        } elsif($rkst[$sabs[2]][1] == 1 && $rkst[$sabs[3]][1] == 0 && $rkst[$sabs[4]][1] == 2) {                      # shshd => [ shhsd ]
          $sabs[2] -=  $rkst[$sabs[2]][1];
          $sabs[3] -= ($rkst[$sabs[3]][1] - 1);
        } elsif($rkst[$sabs[2]][1] == 1 && $rkst[$sabs[3]][1] == 2 && $rkst[$sabs[4]][1] == 3) {                      # shsdc => [ shhdc ]
